def ReadNext(data, recog):
	rect = g.getrect()
	
	if rect == []:
		return False
		
	d = g.getcells([rect[0], rect[1], rect[2], 1])
	
	x0 = d[0]
	y0 = d[1]
	
	found = False
	
	for i in xrange(0, len(recog)):
		r = recog[i]
		
		if IsSL(x0, y0, r):
			
			DeleteSL(x0, y0, r)
			data.append((x0, y0, i))
			found = True
			break
	
	return found

